import React from 'react'
import logo from '../../src/img/logo.png'
import coxinha from '../../src/img/coxinha.jpeg'
import coxinha1 from '../../src/img/coxinhaum.jpeg'
import coxinha2 from '../../src/img/coxinhadois.jpeg'
import '../../src/styles.css';




export default function Pagina1() {
    return (
      <div>
        <h1>Cardapio</h1>
        <h3>EXFOMEADOS</h3>

        <div className='container-cardapio'>

        <img height="90px" src={coxinha} alt="logo"></img> <br></br>
        <img height="90px" src={coxinha1} alt="logo"></img> <br></br>
        <img height="90px" src={coxinha2} alt="logo"></img> <br></br>

        </div>

      </div>
    );
}
